import React from 'react'
import './App.css';
import Task from './components/Task'
import TaskList from './components/TaskList'

const tasks = [
  {
    title: "Learn Flask",
    content: "make an api",
  },
  {
    fullName: "Review React",
    email: "make a tasklist front end",
  },
];


function App() {
  return (
    <div className="App">
      <Task title={tasks[0].title} content={tasks[0].content}/>
    </div>
  );
}

export default App;
